import React, { useState } from 'react';
import axios from 'axios';

const TaskCreateForm = () => {
  const [name, setName] = useState('');
  const [taskType, setTaskType] = useState('');
  const [robotId, setRobotId] = useState('');
  const [userId, setUserId] = useState('');
  const [status, setStatus] = useState('Pending'); // 기본값
  const [startTime, setStartTime] = useState('');
  const [endTime, setEndTime] = useState('');
  const [message, setMessage] = useState('');
  const [isLoading, setIsLoading] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsLoading(true);

    const taskData = {
      name,
      taskType,
      robotId,
      userId,
      status,
      startTime,
      endTime
    };

    try {
      await axios.post('http://172.30.1.28:6000/task/create', taskData, {
        headers: {
          'Content-Type': 'application/json',
        },
      });
      setMessage({ type: 'success', text: 'Task created successfully!' });
      // 폼 초기화
      setName('');
      setTaskType('');
      setRobotId('');
      setUserId('');
      setStatus('Pending');
      setStartTime('');
      setEndTime('');
    } catch (error) {
      // 서버에서 반환된 에러 응답 처리
      const errorMessage = error.response?.data?.message || error.message;
      const statusCode = error.response?.status || 'Unknown status';
      setMessage({ type: 'error', text: `Failed to create task. Error: ${errorMessage} (Status: ${statusCode})` });
      console.error('Error creating task:', error);
    }
    setIsLoading(false);
  };

  return (
    <div style={{ fontFamily: 'Arial, sans-serif', margin: '20px' }}>
      <h2 style={{ textAlign: 'center', margin: '20px 0' }}>Create New Task</h2>
      <form onSubmit={handleSubmit} style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
        {/* 입력 필드 */}
        <input
          type="text"
          placeholder="Task Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
          required
          style={{ width: '300px', padding: '10px', margin: '10px 0', borderRadius: '5px', border: '1px solid #ccc' }}
        />
        <input
          type="text"
          placeholder="Task Type"
          value={taskType}
          onChange={(e) => setTaskType(e.target.value)}
          required
          style={{ width: '300px', padding: '10px', margin: '10px 0', borderRadius: '5px', border: '1px solid #ccc' }}
        />
        <input
          type="text"
          placeholder="Robot ID"
          value={robotId}
          onChange={(e) => setRobotId(e.target.value)}
          required
          style={{ width: '300px', padding: '10px', margin: '10px 0', borderRadius: '5px', border: '1px solid #ccc' }}
        />
        <input
          type="text"
          placeholder="User ID"
          value={userId}
          onChange={(e) => setUserId(e.target.value)}
          required
          style={{ width: '300px', padding: '10px', margin: '10px 0', borderRadius: '5px', border: '1px solid #ccc' }}
        />
        <select
          value={status}
          onChange={(e) => setStatus(e.target.value)}
          required
          style={{ width: '300px', padding: '10px', margin: '10px 0', borderRadius: '5px', border: '1px solid #ccc' }}
        >
          <option value="Pending">Pending</option>
          <option value="In Progress">In Progress</option>
          <option value="Completed">Completed</option>
          <option value="Failed">Failed</option>
        </select>
        <input
          type="datetime-local"
          placeholder="Start Time"
          value={startTime}
          onChange={(e) => setStartTime(e.target.value)}
          style={{ width: '300px', padding: '10px', margin: '10px 0', borderRadius: '5px', border: '1px solid #ccc' }}
        />
        <input
          type="datetime-local"
          placeholder="End Time"
          value={endTime}
          onChange={(e) => setEndTime(e.target.value)}
          style={{ width: '300px', padding: '10px', margin: '10px 0', borderRadius: '5px', border: '1px solid #ccc' }}
        />
        <button
          type="submit"
          disabled={isLoading}
          style={{
            padding: '10px 20px',
            borderRadius: '5px',
            backgroundColor: '#4CAF50',
            color: '#fff',
            border: 'none',
            cursor: 'pointer',
          }}
        >
          {isLoading ? 'Creating Task...' : 'Create Task'}
        </button>
      </form>
      {message && (
        <p style={{ color: message.type === 'error' ? 'red' : 'green' }}>
          {message.text}
        </p>
      )}
    </div>
  );
};

export default TaskCreateForm;
